    Skytech.Commun.Application.GetCodeModulePourMenu = function(pathModule, defaultValue) {
        if (pathModule && pathModule.indexOf("Lea") === 0)
            if (Skytech.Commun.Utils.Utilisateur.GetTypeUtilisateur() === Skytech.Commun.Utils.Utilisateur.TypeUtilisateur.Employe)
                return "CVIP";
            else
                return "CVIE";
        function getInfoModule(pathModule) {
            var parts = pathModule.split("?");
            var nameParts = parts[0].split(".");
            var paramParts = parts[1] ? parts[1].split("&") : [];
            return {
                name: nameParts[0],
                params: paramParts
            }
        }
        function getMatchingParamsCount(a, b) {
            var count = 0;
            for (var i = 0; i < a.length; i++)
                for (var j = 0; j < b.length; j++)
                    if (a[i] === b[j])
                        count++;
            return count
        }
        var listeModules = Skytech.Commun.Application.GetOffreServices();
        var module = getInfoModule(pathModule);
        if (!(listeModules instanceof Array))
            return defaultValue;
        var matches = listeModules.filter(function(element) {
            var moduleName = element.Module ? getInfoModule(element.Module).name : element.Id;
            return moduleName === module.name
        });
        if (matches.length > 1)
            matches.sort(function(a, b) {
                var aParams = getMatchingParamsCount(getInfoModule(a.Module).params, module.params);
                var bParams = getMatchingParamsCount(getInfoModule(b.Module).params, module.params);
                return aParams > bParams ? -1 : aParams < bParams ? 1 : 0
            });
        if (matches.length > 0)
            defaultValue = matches[0].ModuleParent ? matches[0].ModuleParent : matches[0].CodeModule;
        return defaultValue
    }
