    function doitAfficherPopupUpdateAppNative() {
        if (Skytech.Commun.Utils.Support.IsLatestAppVersion() || Skytech.Commun.Application.OpenedFromNotification || Skytech.Commun.Utils.Support.IOS && Skytech.Commun.Utils.Support.IOSVersion.Major < 7)
            return false;
        var dateUpdate = Skytech.Commun.Utils.Support.Android ? Skytech.Commun.Application.ServerConfig.DateUpdateApp.Android : Skytech.Commun.Application.ServerConfig.DateUpdateApp.IOS;
        var now = new Date;
        var dernierAffichageTime = Skytech.Commun.Utils.LocalStorage.GetData("Interception-LastAffichageUpdateAppNative", 0);
        if (dernierAffichageTime + 30 * 24 * 60 * 60 * 1E3 < now.getTime() && dateUpdate + 30 * 24 * 60 * 60 * 1E3 < now.getTime()) {
            Skytech.Commun.Utils.LocalStorage.SetData("Interception-LastAffichageUpdateAppNative", now.getTime(), false, {
                versionPersistant: true
            });
            return true
        }
        if (dernierAffichageTime + 48 * 60 * 60 * 1E3 > now.getTime())
            return false;
        if (now.getDay() !== 6 && now.getDay() !== 0)
            return false;
        if (dateUpdate + 7 * 24 * 60 * 60 * 1E3 > now.getTime())
            return false;
        Skytech.Commun.Utils.LocalStorage.SetData("Interception-LastAffichageUpdateAppNative", now.getTime(), false, {
            versionPersistant: true
        });
        return true
    }
