    function doitAfficherPopupDiskSpace() {
        var deviceStats = Skytech.Commun.Application.LogWorker.GetDeviceStats();
        if (!deviceStats)
            return false;
        var limiteWarning = 50 * 1024 * 1024;
        if (Skytech.Commun.Utils.Support.Android) {
            var limiteSysteme = 10 * 1024 * 1024;
            limiteWarning = 200 * 1024 * 1024;
            if (deviceStats.freeDiskSpace > limiteSysteme && deviceStats.externalFreeDiskSpace > limiteWarning)
                return false;
            else if (isNaN(+deviceStats.freeDiskSpace) || isNaN(+deviceStats.externalFreeDiskSpace))
                return false
        } else if (deviceStats.freeDiskSpace > limiteWarning)
            return false;
        else if (isNaN(+deviceStats.freeDiskSpace))
            return false;
        var dateLastCheck = new Date(Skytech.Commun.Utils.LocalStorage.GetData("Interception-LastAffichageLowDiskSpace", 0));
        var sevenDaysAgo = new Date;
        sevenDaysAgo.setDate(sevenDaysAgo.getDate() - 7);
        if (dateLastCheck > sevenDaysAgo)
            return false;
        return true
    }
