    function asyncBiometryStateQuery(done, error) {
        if (Skytech.Commun.Utils.Support.IsChrome || !Skytech.Commun.Module.ParametresWorker.AppSupportsHardwareBiometry()) {
            done();
            return
        }
        var currentModule = Skytech.Commun.Controller.ControllerWorker.GetCurrentModuleName();
        if (currentModule === "Parametres.Biometrie") {
            done();
            return
        }
        var biometryRefused = Skytech.Commun.Utils.LocalStorage.GetData("Biometry-Refused", false);
        var checksToDo = {
            CheckBiometryEnrollement: !biometryRefused && doitAfficherInterceptionBiometryEnrollment(),
            CheckBiometryKeyLost: doitAfficherInterceptionBiometryKeyLost()
        };
        var anyCheckToDo = false;
        for (var check in checksToDo)
            if (checksToDo[check])
                anyCheckToDo = true;
        if (!anyCheckToDo) {
            done();
            return
        }
        var nativeData = null;
        var delayedDataCallback = null;
        var timeoutTimer = null;
        var isTooLate = false;
        function onCurrentRunningInterception(nativeDataCallback, nativeTimeout) {
            if (!nativeData) {
                delayedDataCallback = nativeDataCallback;
                timeoutTimer = setTimeout(function() {
                    isTooLate = true;
                    timeoutTimer = delayedDataCallback = null;
                    nativeTimeout()
                }, 5E3)
            } else
                nativeDataCallback(nativeData, checksToDo)
        }
        function onNativeCommandCallback(data) {
            if (isTooLate)
                return;
            if (!timeoutTimer)
                nativeData = data;
            else {
                clearTimeout(timeoutTimer);
                delayedDataCallback(data, checksToDo);
                timeoutTimer = delayedDataCallback = null
            }
        }
        done(onCurrentRunningInterception);
        Ovx.Biometry.GetCapabilitiesAndState({}, onNativeCommandCallback)
    }
    function checkInterceptionLecteurBiometrique(data, done) {
        if (!data[2]) {
            done();
            return
        }
        function onNativeData(nativeCommandData, checksToDo) {
            if (!nativeCommandData) {
                done();
                return
            }
            var biometryRefused = Skytech.Commun.Utils.LocalStorage.GetData("Biometry-Refused", false);
            var sensorTypeSuffix = nativeCommandData.SensorType === "face" ? "_Face" : "_Fingerprint";
            var anyPopupShown = false;
            if (!nativeCommandData.BiometrySetupComplete) {
                if (checksToDo.CheckBiometryEnrollement)
                    if (!biometryRefused && nativeCommandData.IsBiometryUsable && !nativeCommandData.BiometrySetupComplete) {
                        anyPopupShown = true;
                        showBiometryEnrollInterception(sensorTypeSuffix, done)
                    }
            } else if (checksToDo.CheckBiometryKeyLost)
                if (nativeCommandData.BiometrySetupComplete && !nativeCommandData.KeyInStorage) {
                    anyPopupShown = true;
                    showBiometryKeyLostInterception(sensorTypeSuffix, done)
                }
            if (!anyPopupShown)
                done()
        }
        function nativeTimeout() {
            done()
        }
        data[2](onNativeData, nativeTimeout)
    }
