    function updatePastille(listeMiseAJour, animate) {
        var i;
        var update;
        var service;
        var bouton;
        var btnService = $("#btnServices").item();
        var totalUpdateModule = {};
        var totalUpdateServices = 0;
        var module;
        var nomModule;
        var nbUpdate;
        var lstIcone = $("#zoneIcones div[data-type='menuIcone']");
        var len;
        if (typeof lstIcone.item(0).iconeSetTextPastille === "undefined")
            return;
        listeMiseAJour = listeMiseAJour || [];
        for (i = 0; i < listeMiseAJour.length; i++) {
            update = listeMiseAJour[i];
            nomModule = update.ModuleMobile || update.IdService;
            nbUpdate = 0;
            if (update.NbNotifications)
                nbUpdate = update.NbNotifications;
            totalUpdateModule[nomModule] = (totalUpdateModule[nomModule] || 0) + nbUpdate;
            if (update.NbNotifications === 0)
                totalUpdateModule[nomModule] = (totalUpdateModule[nomModule] || 0) + 1
        }
        var arrIdUpdatee = [];
        for (module in totalUpdateModule)
            if (totalUpdateModule.hasOwnProperty(module)) {
                var isBoutonBarreIcone = false;
                $('div[data-type="menuIcone"]').each(function() {
                    if (this.item().id === "btn" + module)
                        isBoutonBarreIcone = true
                });
                if (isBoutonBarreIcone) {
                    bouton = $("#btn" + module).item();
                    bouton.iconeSetTextPastille(totalUpdateModule[module], animate);
                    arrIdUpdatee.push("btn" + module)
                } else
                    totalUpdateServices += totalUpdateModule[module]
            }
        if (totalUpdateServices > 0) {
            btnService.iconeSetTextPastille(totalUpdateServices, animate);
            arrIdUpdatee.push("btnServices")
        }
        $('div[data-type="menuIcone"]').each(function(item) {
            if (arrIdUpdatee.indexOf(this.item().id) === -1)
                this.item().iconeSetTextPastille(null, animate)
        });
        if ($(".btnCVIE .pastille").item())
            $(".btnCVIE .pastille").data("listeMiseAJour", JSON.stringify(listeMiseAJour));
        Skytech.Commun.Application.NotificationWorker.ListeUpdated()
    }
