                    var newBottomTranslate = "translate3d(0," + movement + "px,0)";
                    var newHideTranslate = "translate3d(0," + -movement + "px,0)";
                    var i;
                    if (Skytech.Commun.Utils.Support.Android)
                        if (movement === 0) {
                            self.hide();
                            newTopTranslate = "none";
                            newBottomTranslate = "none"
                        } else
                            self.show();
                    for (i = 0; i < _parentNode.childNodes.length; i++) {
                        if (!_parentNode.childNodes[i].style)
                            continue;
                        if (_parentNode.childNodes[i] === self.item())
                            _parentNode.childNodes[i].style.webkitTransform = newTopTranslate;
                        else if (!$(_parentNode.childNodes[i]).hasClass("scrollModeTop"))
                            _parentNode.childNodes[i].style.webkitTransform = newBottomTranslate;
                        else {
                            _parentNode.childNodes[i].style.top = movement + "px";
                            _parentNode.childNodes[i].style.position = "relative";
                            if (Skytech.Commun.Utils.Support.Android)
                                $(".scrollModeTopFixed", _parentNode.childNodes[i]).each(function() {
                                    this.item().style.marginTop = movement + "px"
                                })
                        }
                    }
                    _divHide.style.webkitTransform = newHideTranslate
