                    $(".updateTime").html(Dictio.COMMUN.UI_0015 + " " + Skytech.Commun.Utils.Date.TimestampToReadableString(+_dataLastUpdateTime, Skytech.Commun.Utils.Date.TypeFormat.TYPE_REFRESH));
