                    var objUNNotificationSetting = {
                        "0": "NotSupported",
                        1: "Disabled",
                        2: "Enabled"
                    };
                    var objDoc = {
                        authorizationStatus: {
                            "0": "NotDetermined",
                            1: "Denied",
                            2: "Authorized",
                            3: "Provisional"
                        },
                        lockScreenSetting: objUNNotificationSetting,
                        notificationCenterSetting: objUNNotificationSetting,
                        alertSetting: objUNNotificationSetting,
                        alertStyle: {
                            "0": "None",
                            1: "Banner",
                            2: "Alert"
                        },
                        soundSetting: objUNNotificationSetting,
                        badgeSetting: objUNNotificationSetting
                    };
                    var etatPush;
                    if (data.authorizationStatus === 2)
                        etatPush = true;
                    else if (data.authorizationStatus === 1)
                        etatPush = false;
                    for (var cleADetailler in objDoc)
                        data[cleADetailler] += " (" + objDoc[cleADetailler][data[cleADetailler]] + ")";
                    callback(etatPush, undefined, JSON.stringify(data, null, 4))
